// inputTypes.js
export const inputTypeConfig = {
  text: { type: "text", readOnly: false },
  number: { type: "number", readOnly: false },
  email: { type: "email", readOnly: false },
  password: { type: "password", readOnly: true },
  date: { type: "date", readOnly: false },
};
